const initialState = {
  houses: [
    {
      id: 1,
      name: "GreyJoy",
      region: "The Westerlands",
    },
  ],
};

export const houseReducer = (state, { type, payload }) => {
  switch (type) {
    case ActionTypes.SET_PRODUCTS:
      return state;
    default:
      return state;
  }
};
